import React from 'react'
import '../assets/homeStyle.css'

const Home = () => {
    return (
        <div>
            <h1 className='hello'>Hello</h1>
            <h1>I am</h1>
            <h1>Lisa</h1>
        </div>
    )
}

export default Home
